    value: The Blast email & <200 blastfax does not meet the definition of Federal
      Election Activity and opening a bulk mail account is an administrative expense
      also not meeting the definition of Federal Election Activity.The payments for
      rent to the Democratic State Central Committee (Non-Fed) are not reimbursements
      to the non-federal account for shared allocable expenses.  The payments are
      for rent for our nightly bingo games which is required under State law.  The
      transfers to the non-federal account were not used to finance any activity in
      connection with federal elections. Transfers from the Democratic National Committee
